(108, 21, '<p>Shkruani kodin e <b style=\"background-color: rgb(255, 255, 0);\">Preorder</b>, <b style=\"background-color: rgb(255, 255, 0);\">Postorder</b>, dhe <b><span style=\"background-color: rgb(255, 255, 0);\">Inorder</span>. </b>Si dhe tregoni renditjen e nodes ne foto per secilen.</p><p><img src=\"data:image/png;base64,\" style=\"width: 375.662px; height: 271.399px;\" data-filename=\"pre.png\"><br></p><p><br></p>', 1, 3, 20),
(109, 21, '<p>Shkruani një metodë e cila do të heqë çdo karakter të dhënë nga një varg?</p><p><br></p>', 1, 3, 20),
(110, 21, '<p>Si të gjeni dy numrin maksimal të lartë në një grup? Psh. Nese kemi array <span style=\"font-family: &quot;Times New Roman&quot;;\">[1,4,22,33,44,41]</span> duhet te na kthej numrin <b>41</b></p>', 1, 3, 10),
(111, 21, '<p>Qfare returnon kodi i me poshtem ne Konsole?</p><pre>public class StringPrograms {<br><span style=\"font-size: 1rem;\">&nbsp; &nbsp; public static void main(String[] args) {</span><br><span style=\"white-space:pre\">		</span>String str = \"123\";<br><span style=\"white-space:pre\">		</span>System.out.println(reverse(str));<br><span style=\"white-space:pre\">	</span>}<br><span style=\"white-space:pre\">	</span>public static String reverse(String in) {<br><span style=\"white-space:pre\">		</span>if (in == null)<br><span style=\"white-space:pre\">			</span>throw new IllegalArgumentException(\"Null is not valid input\");<br><span style=\"white-space:pre\">		</span>StringBuilder out = new StringBuilder();<br><span style=\"white-space:pre\">		</span>char[] chars = in.toCharArray();<br><span style=\"white-space:pre\">		</span>for (int i = chars.length - 1; i &gt;= 0; i--)<br><span style=\"white-space:pre\">			</span>out.append(chars[i]);<br><span style=\"white-space:pre\">		</span>return out.toString();<br><span style=\"white-space:pre\">	</span>}<br>}</pre>', 1, 3, 30),
(112, 21, '<p>Shtoni 2 delegate dhe n je event per kodin e meposhtem</p><pre style=\"margin-left: 25px;\"><div style=\"text-align: left; margin-left: 25px;\">public delegate int Mbledh(int a, int b);</div><div style=\"text-align: left; margin-left: 25px;\">public delegate int Zbrit(int a, int b);</div><div style=\"text-align: left; margin-left: 25px;\">namespace Delegates</div><div style=\"text-align: left; margin-left: 25px;\">{</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; class Program</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; {</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; &nbsp; &nbsp; static void Main(string[] args)</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; &nbsp; &nbsp; {</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Mbledh x = new Mbledh(AddSum);</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Zbrit y = new Zbrit(Subtract);</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; int resultShuma = x(5, 5);</div><div style=\"text-align: left; margin-left: 25px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; int resultZbritja = y(10, 5);</div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Console.ReadKey();</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; }</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; public static int AddSum(int a, int b)</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; {</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;return a+b;</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; }</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; public static int Subtract(int a, int b)</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; {</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return a - b;</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; }</div><div style=\"text-align: left;\">&nbsp; &nbsp; }</div><div style=\"text-align: left;\">}</div></pre>', 1, 3, 20),
