(114, 21, '<p>Katër parimet e programimit të orientuar nga objekti janë</p><p style=\"text-align: left; margin-left: 25px;\">A) Enkapsulimi</p><p style=\"text-align: left; margin-left: 25px;\">B) Abstraksioni</p><p style=\"text-align: left; margin-left: 25px;\">C) Trashëgimia </p><p style=\"text-align: left; margin-left: 25px;\">D) Polimorfizmi</p><p style=\"text-align: left; margin-left: 25px;\">E) Klasa</p><p style=\"text-align: left; margin-left: 25px;\"><br></p>', 1, 3, 10),
